import React from 'react';
import Container from 'react-bootstrap/Container';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Image from 'react-bootstrap/Image';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../Styles/About.css';
import GitHub_Logo from '../components/GitHub_Logo.png';
import Rose from '../components/rose.jpg';
import YelpCamp from '../components/YelpCamp.png';
const About = () => (

<Container className="aboutBody" fluid>
   <Jumbotron className="aboutJumbo" fluid>
   <link href="https://fonts.googleapis.com/css?family=Fredericka+the+Great|Lateef|Rubik:500|Open+Sans|Rancho|Nunito|Permanent+Marker&display=swap" rel="stylesheet"></link>

  <Container>
  <h1 className ="aboutTitle">About Me</h1>
  <Row>

  {/* <Col lg={6}>
    <Image  className='aboutImage' src={YelpCamp}   thumbnail/> 
  </Col> */}


  <Col lg={12} >


    <p className = "aboutContent">
    It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. 
    The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using 'Content here, content here', making it look like readable English. 
    Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for 'lorem ipsum' will uncover many web sites still in their infancy. 
    Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).

    </p>


    </Col>
    <Col lg={12}>


    <Image src={GitHub_Logo}/>
    </Col>

    </Row>
  </Container>
</Jumbotron>
</Container>
)

export default About
